@rmflight @klmr Just make sure u use a setting that is agile to the current version of R running, eg

R_LIBS_USER=~/R/%p-library/%v

See ?R_LIBS_USER for those flags.  Also, it's super unfortunate that #RStats will *silently* ignore that folder if it does not exist (same problem w/ .libPaths())

